          "title": "Dilatación del tiempo: ¡explicación de la teoría de la relatividad de Einstein!",
          "description": "La dilatación del tiempo y la teoría de la relatividad de Einstein van de la mano. Albert Einstein es el físico más popular, ya que formuló la teoría de la relatividad, que dio la fórmula de equivalencia de masa de energía y está directamente relacionada con la dilatación del tiempo. Pero, ¿qué es la dilatación del tiempo? La dilatación del tiempo y el espacio-tiempo están interrelacionados. Einstein hizo una de las contribuciones más importantes a la física y explicó el concepto de espacio-tiempo. Una explicación simple del espacio-tiempo es que es un modelo matemático que fusiona las tres dimensiones del espacio y la única dimensión del tiempo en un solo continuo de cuatro dimensiones. Pero es muy importante entender que la teoría de la relatividad general y la teoría de la relatividad especial son diferentes. En este breve video animado, damos una explicación simple de la dilatación del tiempo y la teoría de la relatividad de Einstein y también explicamos cómo el tiempo se ralentiza en un vehículo en movimiento.\n\n\n #ciencia #animación #dilatacióndeltiempo #TeoríadelaRelatividad\n\n Referencias:\n\n https://faraday.physics.utoronto.ca/PVB/Harrison/GenRel/TimeDilation.html\n http://newt.phys.unsw.edu.au/einsteinlight/jw/module4_time_dilation.htm\n https://web.pa.msu.edu/courses/2000fall/PHY232/lectures/relativity/dilation.html\n http://www.física.nyu.edu/~ts2/Animation/Time_dilation.html\n\n\n ¡SUSCRÍBETE para recibir más videos científicos de este tipo!\n https://www.youtube.com/channel/UCcN3IuIAR6Fn74FWMQf6lFA?sub_confirmation=1\n\n ¡Síganos en Twitter!\n https://twitter.com/abc_science\n\n ¡Síguenos en Facebook!\n https://facebook.com/sciabc\n\n ¡Sigue nuestro sitio web!\n https://www.scienceabc.com"
